window.bookSummaryJSON = "<p><b>Keep your friends close and your enemies closer; that's what they say. Who knew my biggest enemy would share my blood?</b></p> <p>I've been dreaming of this moment my entire life. The day I reclaim my birthright, ascend the throne, and claim my crown. Yet the instant I am proclaimed Queen of Floodborn, chaos ensues.</p> <p>My aunt is fueled by revenge, her sights set on me and my kingdom. But with my fated mates by my side, I will stop at nothing to protect those I love and the citizens I have promised a better future.</p> <p>She has no idea what I've been through and I won't let my people down without a fight. Underestimating me will be her biggest regret because a new court is in session…</p> <p>All hail the rightful Queen!</p>"; 
